import './App.css';
import Row from "./Row";
import requests from './Requests';
import Banner from './Banner';

function App() {
  return (
    <div className="App">
      <Banner 
        fetchUrl={requests.fetchTrending}/>
              <Row 
        title = "Netflix Originals" 
        fetchUrl={requests.fetchNetflixOriginals} 
        isLargeRow={true} />
      <Row 
        title = "Trending Now" 
        fetchUrl={requests.fetchTrending} />


    </div>
  );
}

export default App;
